import React from 'react';

const main = (props) => {
    return (
        <div>
            <main role="main" className="col-md-9 ml-md-auto col-lg-9 ">
                <div className="d-flex justify-content-between flex-wrap flex-md-nowrap align-items-center pt-3 pb-2 mb-3 border-bottom">
                    {props.children}
                </div>
            </main>

        </div>
    );
}

export default main;
